import React from "react";
import "./PopularSchools.css";
import "react-responsive-carousel/lib/styles/carousel.min.css"; // requires a loader
import { Carousel } from 'react-responsive-carousel';
const PopularSchools = () => {
  return (
    <div className="popular">
        <Carousel></Carousel>
      <div className="fpItem" onClick={()=>{
        window.location.href="https://stpetersmodelschool.co.in/"
      }}>
        <img
          alt=""
          src="data:image/jpeg;base64,"
          className="popularImg"
        />
        <span className="popularName">ST.Peters Model School</span>
        <span className="popularCity">Hyderabad</span>
        <div className="popularRating">
          <button>9.0</button>
          <span>Excellent</span>
        </div>
      </div>
      <div className="fpItem" onClick={()=>{
        window.location.href="http://localhost:3000/school/1"
      }}>
        <img
          alt=""
          src="data:image/jpeg;base64,"
          className="popularImg"
        />
        <span className="popularName">Nalla Malla Reddy Engineering College</span>
        <span className="popularCity">Hyderabad</span>
        <div className="popularRating">
          <button>7.0</button>
          <span>Good</span>
        </div>
      </div>
      <div className="fpItem" onClick={()=>{window.location.href="https://www.dpshyderabad.in/"}
      }>
        <img
          alt=""
          src="data:image/jpeg;base64,"
          className="popularImg"
        />
        <span className="popularName">Delhi Public School</span>
        <span className="popularCity">Hyderabad</span>
        <div className="popularRating">
          <button>9.0</button>
          <span>Excellent</span>
        </div>
      </div>
    </div>
  );
};

export default PopularSchools;
